import classes from "./WelcomeText.module.css";

const WelcomeText = () => {
  return (
    <Fragment>
      <div className="welcome__text">
        <span>
          <h1>connect</h1>
        </span>
        <span>
          <h1>share</h1>
        </span>
        <span>
          <h1>cheer..</h1>
